import React from 'react';

import { BadgeContainer } from './BadgeContainer';

function Badge({ id, image, heading, text }) {
	return (
		<BadgeContainer>
			<div>
				<img src={image} alt='' />
				<h2> {heading} </h2>
				<p> {text} </p>
			</div>
		</BadgeContainer>
	);
}

export default Badge;
